import React, { useState, useEffect } from 'react'

function App() {
    //declare variable to hold response data
    const [data, setData] = useState([{}])

    useEffect(() => {
        //send http request get to backend /time
        fetch("/time", {
            //set http request parameters
            method: 'GET',
            mode: 'cors',
            cache: 'no-cache',
            credentials: 'same-origin',
            headers: {
                'Content-Type': 'application/json'
            },
            redirect: 'follow',
            referrerPolicy: 'no-referrer'
        }).then(
            //parse response in json()
            res => res.json()
        ).then(
            data => {
            //write into var
            setData(data)
            //print to console
            console.log(data)
            }
        )
    //empty array to only fetch once []
    }, [])




    return (
        <div>
            {
                (typeof data === 'undefined') ? (
                    <p>backend /time has not yet sent a response</p>
                ) : (
                    <p>{ data.time }</p>
                )
            }
        </div>
    )
}

export default App
